const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");
canvas.width  = window.innerWidth;
canvas.height = window.innerHeight;
let particleArray = [];


// get mouse mouse position ///////////////////////////////
let mouse = {
    x: null,
    y: null,
    radius: 80
}
window.addEventListener('mousemove',
    function(event){
        mouse.x = event.x + canvas.clientLeft/2;
        mouse.y = event.y + canvas.clientTop/2;
    });

function drawImage(){
    let imageWidth = png.width || png.naturalWidth;
    let imageHeight = png.height || png.naturalHeight;
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    ctx.clearRect(0,0,canvas.width, canvas.height);
    class Particle {
        constructor(x, y, color, size){
            // this.x = x + canvas.width/2-png.width*2,
            // this.y = y + canvas.height/2-png.height*2,
            this.x = x,
            this.y = y,
            this.color = color,
            this.size = 3,
            this.baseX = this.x,
            this.baseY = this.y,
            this.density = ((Math.random() * 10) + 2);
            this.zero = Math.random() >= 0.5;
            this.distance = 0;
        }
        draw() {
            if(this.distance > mouse.radius + this.size) return;
            ctx.fillStyle = "#ffffffff";
            ctx.beginPath();
            ctx.arc(this.baseX, this.baseY, this.size, 0, Math.PI*2);
            ctx.fill();
            ctx.closePath();
            if(this.zero) {
                ctx.beginPath();
                ctx.moveTo(this.x - this.size, this.y - this.size);
                ctx.lineTo(this.x, this.y - this.size);
                ctx.lineTo(this.x, this.y + this.size);
                ctx.lineWidth = 1;
                ctx.strokeStyle = this.color;
                ctx.stroke();
            }
            else {
                ctx.beginPath();
                ctx.moveTo(this.x - this.size, this.y - this.size);
                ctx.lineTo(this.x + this.size, this.y - this.size);
                ctx.lineTo(this.x + this.size, this.y + this.size);
                ctx.lineTo(this.x - this.size, this.y + this.size);
                ctx.lineTo(this.x - this.size, this.y - this.size);
                ctx.lineWidth = 1;
                ctx.strokeStyle = this.color;
                ctx.stroke();
            }
        }
        update() {
            ctx.fillStyle = this.color;
            // check mouse position/particle position - collision detection
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx*dx + dy*dy);
            this.distance = distance;
            let forceDirectionX = dx / distance;
            let forceDirectionY = dy / distance;
            // distance past which the force is zero
            var maxDistance = 80;
            var force = (maxDistance - distance) / maxDistance;

            // if we go below zero, set it to zero.
            if (force < 0) force = 0;

            let directionX = (forceDirectionX * force * this.density) * 0.9;
            let directionY = (forceDirectionY * force * this.density) * 0.9;

            if (distance < mouse.radius + this.size){
                this.x -= directionX;
                this.y -= directionY;
            } else {
                if (this.x !== this.baseX ) {
                    let dx = this.x - this.baseX;
                    let dy = this.y - this.baseY;
                    this.x -= dx/5;
                } if (this.y !== this.baseY) {
                    let dx = this.x - this.baseX;
                    let dy = this.y - this.baseY;
                    this.y -= dy/5;
                }
            }
            this.draw();
        }
    }
    function init(){
        particleArray = [];
        for (var y = 0, y2 = data.height; y < y2; y++) {
            for (var x = 0, x2 = data.width; x < x2; x++) {
                if (y % 3 != 0 || x % 3 != 0) continue;
                if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 0) {
                    let positionX = x;
                    let positionY = y;
                    let color = "rgb("+data.data[(y * 4 * data.width)+ (x * 4)]+","+data.data[(y * 4 * data.width)+ (x * 4) +1]+","+data.data[(y * 4 * data.width)+ (x * 4) +2]+")";
                    particleArray.push(new Particle(positionX * 1, positionY * 1, color));
                }
            }
        }
    }
    function animate(){
        requestAnimationFrame(animate);
        ctx.fillStyle = 'rgba(255,255,255,.2)';
        // ctx.fillRect(0,0,innerWidth,innerHeight);
        ctx.clearRect(0,0,innerWidth,innerHeight);
        for (let i = 0; i < particleArray.length; i++){
            particleArray[i].update();
        }
    }
    init();
    animate();

    // RESIZE SETTING - empty and refill particle array every time window changes size + change canvas size
    window.addEventListener('resize',function(){
        canvas.width = innerWidth;
        canvas.height = innerHeight;
        init();
    });
}


var png = new Image();
png.src = "data:image/png;base64,";

// Run drawImage after page has been fully loaded
window.addEventListener('load', (event) => {
    console.log('page has loaded');
    ctx.drawImage(png, 0, 0);
    drawImage();
});
